import React from 'react'
import CardList from "./cardlist";
import { robots } from "./robots";
import SearchBox from './searchbox';

const state = {
    robots: robots,
    searchField: '',
}

class App extends React.Component {
    constructor(){
        super();
        this.state = {
            robots: robots,
            searchField: "",
        };
    }
    render(){
        return (
            <div className="tc">
                <h1>robofriends</h1>
                <SearchBox />
                <CardList robots={this.state.robots} />
            </div>
        );
    }
}

export default App;
